                    type: 'GET',
                    data: { id: id }, // Envia o parâmetro como parte da solicitação
                    success: function (data) {
                        modal.find('.modal-body').html(data);
                    },
                    error: function () {
                        modal.find('.modal-body').html('<p>Erro ao carregar os dados.</p>');
