// Cria um objeto de mapeamento ID para label
var itemMap = {};
    items.forEach(item => {
        itemMap[item.id] = item.label;
    });

    // Para verificar o label correspondente a um ID
    function getLabelById(id) {
        return itemMap[id] || 'Unknown';
    }

    // Atualiza os rótulos na página
    document.querySelectorAll('.itemLabel').forEach(function(td) {
        var itemId = td.getAttribute('data-item-id');
        var label = getLabelById(parseInt(itemId, 10)); // Certifica-se de que itemId é um número
        td.innerText = label;
    });
</script>
